import React,{Component} from 'react';
class Footer extends Component{
  constructor(props){
    super(props);
    this.state={
      color:'red',
      name:'venkat'
    };
  }
  render(){
    return(
    <div>
      <p>{this.state.color}</p>
    <p></p>{this.state.name}
    </div>
    );
  }
}
export default Footer;
